Zapiszmy wagi tych czterech czestkoszy w postaci równań. Niech $t$ oznacza wagę jednego treeka, $s$ oznacza wagę jednego squigi, a $g$ oznacza wagę jednego goolea. Wówczas mamy:
\begin{align*}
10t &= 3s + g \\
2t + g &= s
\end{align*}
Rozwiązujemy ten system równań. W drugim równaniu zapiszemy $g$ w postaci $g = s - 2t$. Wstawiając ten wyrażenie do drugiego równania mamy:
\begin{align*}
10t &= 3s + (s - 2t) \\
12t &= 4s \\
3t &= s
\end{align*}
Zatem trzy treeki ważą tyle samo, co jedna squiga. $\boxed{3}$

