Zakładamy, że siła, z jaką rzuca piłka softballową, to ta samej, z jaką rzuca piłka baseballową. Wtedy zasadnicze równania prawa Newtona dla piłki softballowej i piłki baseballowej to:

\begin{align*}
F &= m_{\text{ softball}} \cdot a_{\text{ softball}} \\
F &= m_{\text{ baseball}} \cdot a_{\text{ baseball}}
\end{align*}

Zatem

\begin{align*}
m_{\text{ softball}} \cdot a_{\text{ softball}} &= m_{\text{ baseball}} \cdot a_{\text{ baseball}} \\
200 \cdot a_{\text{ softball}} &= 150 \cdot a_{\text{ baseball}} \\
\frac{a_{\text{ softball}}}{a_{\text{ baseball}}} &= \frac{150}{200} = \boxed{\frac{3}{4}}
\end{align*}

